export default {
    
    props: {
      data: Object,
      colors: Object,
    },

    data: {
      data:null,
      width:760,
      height:739
    },
    computed: {

    },
    connected(){
      const { $el, width, height } = this;
      const { select } = d3;
      let highlightPath;
      const svg = select(append($el, `<svg width="${width}" height="${height}" viewBox="0 0 ${width} ${height}">`));
      // each(mapPath, (i, e)=>{
      //   svg.append('path')
      //     .attr("class", "map_area")
      //     .attr('d', i.path)
      //     .attr('fill', i.fill)
      // })
      const mask = svg.append("mask")
        .attr('fill', 'white')
        .attr('id', "el_hilight")
      const maskPath = mask.append('path')
        

      const series = svg.selectAll(".series")
        .data(mapPath)
        .join("path")
        .attr("class", "map_area")
        .attr('d', d => d.path)
        .attr('fill', d => d.fill)
        .on("click", highlight)
        // .attr("fill", d => colors[d[0].rank])
        // .attr("stroke", d => colors[d[0].rank])

        function highlight(e, d){
          const activePath = series.filter(s => d === s);
          if (!!highlightPath) {
            if (highlightPath !== activePath) {
              highlightPath.attr('stroke-width', '0')
              highlightPath.attr('mask', '')
            }else {
              return;
            }
          }

          
          activePath
            .attr('stroke', '#F9FE00')
            .attr('stroke-width', '6')
            .attr('mask', 'url(#el_hilight)')
          maskPath.attr('d', d.path)
          highlightPath = activePath;
          // console.dir(d.path);
        }
    },

    methods: {
      render() {

      },
      highlight(el) {
        console.log(el);
      }
    }
};





